import React, { Component } from 'react'
import jsTPS_Unit_Tests from '../test_beds/jsTPS_Unit_Tests'

class TestBedScreen extends Component {

    runTests() {
        let tests = new jsTPS_Unit_Tests();
        document.write('Running tests on jsTPS...<br>');
        document.write('Test (1/6): Testing add function...<br>');
        tests.testAdd();
        document.write('Test passed.<br><br>');

        document.write('Test (2/6): Testing andMask function...<br>');
        tests.testAndMask();
        document.write('Test passed.<br><br>');

        document.write('Test (3/6): Testing orMask function...<br>');
        tests.testOrMask();
        document.write('Test passed.<br><br>');

        document.write('Test (4/6): Testing undoTransaction function...<br>');
        tests.testUndo();
        document.write('Test passed.<br><br>');

        document.write('Test (5/6): Testing redoTransaction function...<br>');
        tests.testRedo();
        document.write('Test passed.<br><br>');

        document.write('Test (6/6): Testing clearAllTransactions function...<br>');
        tests.testClear();
        document.write('Test passed.<br><br>');
        document.write('All tests on jsTPS passed.<br>');
    }

    render() {
        return (
            <div>
                <p>
                    {this.runTests()};
                </p>
                <div>
                    <p>Click 'Back' to exit test bed.</p>
                    <button onClick={this.props.goTestHome}>Back</button>
                </div>
            </div>
        )
    }
}

export default TestBedScreen;
